function computeScaledSize(originalWidth, originalHeight, newWidth, newHeight) {

    // Landscape Style
    if(originalWidth > originalHeight) { // image width is larger than image height
        if(originalWidth != newWidth) { // must resize image by canvas width
            return computeScaledSizeByHeightOrWidth(originalWidth, originalHeight, "width", newWidth);
        }else if(originalHeight != newHeight) { // must resize image by canvas height
            return computeScaledSizeByHeightOrWidth(originalWidth, originalHeight,"height", newHeight);
        }else{ // no need to resize image
            var result = {};
            result["width"] = originalWidth;
            result["height"] = originalHeight;
            return result;
        }

    // Portriat Style
    }else if(originalHeight > originalWidth) { // image height is larger than image width
        if(originalHeight != newHeight) { // must resize image by canvas height
            return computeScaledSizeByHeightOrWidth(originalWidth, originalHeight,"height", newHeight);
        }else if(originalWidth != newWidth) { // must resize image by canvas width
            return computeScaledSizeByHeightOrWidth(originalWidth, originalHeight, "width", newWidth);
        }else{ // no need to resize image
            var result = {};
            result["width"] = originalWidth;
            result["height"] = originalHeight;
            return result;
        }

    // 50/50 Square Style
    }else{ // image height is equal to image width
        if(newWidth > newHeight) { // must resize image by canvas width
            return computeScaledSizeByHeightOrWidth(originalWidth, originalHeight,"height", newHeight);
        }else if(newHeight > newWidth) { // must resize image by canvas height
            return computeScaledSizeByHeightOrWidth(originalWidth, originalHeight,"height", newHeight);
        }else{ // newsize is 50/50 Square Style as well
            var result = {};
            result["width"] = newWidth;
            result["height"] = newHeight;
            return result;
        }
    }
}

function computeScaledSizeByHeightOrWidth(originalWidth, originalHeight, scaleByHeightOrWidth, newHeightOrWidth) {

    var result = {};
    var num = 0;

    var newHeight = 0;
    var newWidth = 0;

    var isHeight = false;
    var isWidth = false;

    if(scaleByHeightOrWidth == "width") {
        if(originalWidth != newHeightOrWidth) {
            isWidth = true;
        }
    }else if(scaleByHeightOrWidth == "height") {
        if(originalHeight != newHeightOrWidth) {
            isHeight = true;
        }
    }else{
        console.log("computeScaleSizeByHeightOrWidth: 'scaleByHeightOrWidth' only takes 'width' or 'height' as correct arguments.");
    }

    if(isWidth) {
        newWidth = newHeightOrWidth;
        num = (originalHeight / originalWidth) * newWidth;
        newHeight = Math.round(num);
    }else if(isHeight){
        newHeight = newHeightOrWidth;
        num = (originalWidth / originalHeight) * newHeight;
        newWidth = Math.round(num);
    }else{
        newWidth = originalWidth;
        newHeight = originalHeight;
    }

    result["width"] = newWidth;
    result["height"] = newHeight;

    return result;
}

function computeScaledXandY(imgWidth, imgHeight, canvasWidth, canvasHeight) {

    var x = 0;
    var y = 0;
    var num = 0;
    var result = {};

    if(imgWidth == canvasWidth && imgHeight == canvasHeight) {
        x = 0;
        y = 0;
    }else{
        if(imgWidth == canvasWidth) {
            x = 0;
            num = (canvasHeight - imgHeight) / 2;
            y = Math.round(num);
        }else if (imgHeight == canvasHeight) {
            y = 0;
            num = (canvasWidth - imgWidth) / 2;
            x = Math.round(num);
        }else{
            num = (canvasWidth - imgWidth) / 2;
            x = Math.round(num);
            num = (canvasHeight - imgHeight) / 2;
            y = Math.round(num);
        }
    }

    result["x"] = x;
    result["y"] = y;

    return result;
}

